import { createSlice } from '@reduxjs/toolkit'

export const userSlice = createSlice({
  name: 'user',
  initialState: {
    user: {}
  },
  reducers: {
    add_user: (state, user) => {
      state.user = user;
    }
  }
})

export const { add_user } = userSlice.actions

export default userSlice
